                <TableRow key={index}>
                  <TableCell className={classes.tablecell}>
                    {element.category_name}
                  </TableCell>
                  <TableCell className={classes.tablecell}>
                    {element.common_topic_name ? (
                      <a href={element.common_topic_url} target="blank">
                        {element.common_topic_name}
                      </a>
                    ) : (
                      element.common_topic_name
                    )}
                  </TableCell>
                  {/*<TableCell >
                   <Button
                        className={classes.btnedit}
                        onClick={() => {
                          setEditData({
                            commontopicid: element.id,
                            commontopicname: element.common_topic_name,
                            commontopicurl: element.common_topic_url,
                            commontopicstatus: element.is_completed,
                          });
                          onEditCommonTopic(element.id);
                        }}
                      >
                        Edit
                      </Button>
                    <Button
                    className={classes.btnedit}
                    onClick={() => setDelete(true)}>Delete</Button>
                  </TableCell> */}
                  {/* <TableCell className={classes.tablecell}>{element.is_completed}</TableCell> */}
                  {/* {element.is_completed === true ? <TableCell className={classes.tablecell}>Completed</TableCell> : <TableCell className={classes.tablecell}>Not Completed</TableCell>} */}
                  {user.user_type === "resource" ? (
                    <TableCell>
                      {element.is_completed === true
                        ? "Completed"
                        : "Not Completed"}
                    </TableCell>
                  ) : (
                    ""
                  )}
                  {/* {element.common_topic_url ? <TableCell className={classes.tablecell}><a href={element.common_topic_url} target='blank'>click here</a></TableCell> */}
                  {/* :<TableCell className={classes.tablecell}>-</TableCell>} */}
                  {/* {element.common_topic_file ? <TableCell className={classes.tablecell}><a href={element.common_topic_file} target='blank'>click here</a></TableCell>
                                            :<TableCell className={classes.tablecell}>-</TableCell>} */}
                  {user.user_type === "resource" ? (
                    <TableCell>
                      <Button
                        style={{
                          display:"flex",
                          alignItems:"center",
                          justifyContent:"center",
                          color: "#00a8ff",
                          cursor: "pointer"
                        }}
                        // className={classes.btnedit}
                        onClick={() => {
                          setEditData({
                            commontopicid: element.id,
                            commontopicname: element.common_topic_name,
                            commontopicurl: element.common_topic_url,
                            commontopicstatus: element.is_completed,
                          });
                          onEditCommonTopic(element.id);
                        }}
                      >
                        Edit
                      </Button>

                      {/* {user_permission_list.delete_commontopic === true ? 
                                    <DeleteForeverOutlinedIcon className={classes.btndelete}
                                        onClick={()=>{  
                                            setDeleteData({
                                                commontopicid:element.id
                                            })
                                        ;onDeleteCommonTopic()}}
                                    
                                    ></DeleteForeverOutlinedIcon>
                                    : "" } */}
                    </TableCell>
                  ) : (
                    ""
                  )}
                </TableRow>
              ))
            ) : (
              <div className={classes.nodata}>
                <p>No data found</p>
              </div>
            )}
           
            
          {post && post.length > 0 ? (
            <TablePagination
              component="div"
              rowsPerPageOptions={[5, 10, 15]}
              count={post.length}
              rowsPerPage={rowsPerPage}
              page={page}
              onChangePage={handleChangePage}
              onChangeRowsPerPage={handleChangeRowsPerPage}
            />
          ) : (
            ""
          )}
        </div>
    )
}

export default Page;
